import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function SelectLabelsGym() {
    const [Gym, setGym] = React.useState('');


    const handleChange = (event) => {
        setGym(event.target.value);
    };


    return (
        <div>
            <FormControl sx={{ m: 1, minWidth: 120 }}>
                <InputLabel id="demo-simple-select-helper-label">Gym time </InputLabel>
                <Select
                    labelId="demo-simple-select-helper-label"
                    id="demo-simple-select-helper"
                    value={Gym}
                    label="choose your Gym time"
                    onChange={handleChange}
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>5-6</MenuItem>
                    <MenuItem value={20}>6-7</MenuItem>
                    <MenuItem value={30}>8-9</MenuItem>
                </Select>
                <FormHelperText>choose your gym time</FormHelperText>
            </FormControl>
            <FormControl sx={{ m: 1, minWidth: 120 }}>

            </FormControl>
        </div>
    );
}
